import React from "react";
import { View, Text, Button, StyleSheet, Image, TextInput } from "react-native";

const Home = ({ navigation }) => (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "flex-start", background: "./assets/hospital.png" , paddingLeft: 400  }}>
        <Image source={require("./assets/hospital.png")} style={styles.img} />
        <Text style={styles.logtxt}>Chào Mừng Ngày Quốc Tế 19/11</Text>
    </View>
);

const styles = StyleSheet.create({

     
    logtxt: {
        fontSize: 40,
        fontWeight: "bold",
        textAlign: "center",

        margin:"center",
        paddingBottom: 30,
        paddingTop: 10,
    },
   
});

export default Home;
